import React from "react";
import ChangePasswordPage from "../../../components/ChangePassword";
import MahasiswaLayout from "../components/MahasiswaLayout";

const ChangePassword = () => {
    return (
        <>
            <MahasiswaLayout>
                <ChangePasswordPage />
            </MahasiswaLayout>
        </>
        
    )
}

export default ChangePassword;
